    [],nt"revision_timestamp": "2015-09-27T02:55:10.122145",nt"name": "cost-earnings-data-1993-hawaii-longline",nt"isopen":
    false,nt"url": null,nt"notes": "These data were collected to support the
    first cost-earnings study of this fleet.  Operational and vessel costs were collected
    by in-person interviews with vessel owners, captains, and crew. Revenue information
    was obtained from the Hawaii Department of Aquatic Resources commercial catch reports
    and NMFS logbooks (fishing effort).  A total of 95 vessels (out of 122 active vessels
    in 1993) were interviewed and M. S. Hamilton, R.E. Curtis, and M.D. Travis conducted
    the project.",nt"license_title": null,nt"extras": [{ntt"key": "temporal-extent-begin",ntt"value":
